proc draw_map

	; function that draws the map
	
	pusha
	
	
	mov cx, 45

	mov al, 0Fh 
	mov ah, 0Ch 
	mov cx, 106
	mov dx, 66 

	; vertical lines
	mov cx, 106
	mov dx, 0
draw_vertical_line:
    mov ah, 0Ch
    int 10h
    inc dx
    cmp dx, 200
    jb draw_vertical_line


	mov cx, 213
	mov dx, 0
draw_vertical_line2:
    mov ah, 0Ch
    int 10h
    inc dx
    cmp dx, 200
    jb draw_vertical_line2

	; horizontal lines
	mov cx, 0
	mov dx, 66
draw_horizontal_line:
    mov ah, 0Ch
    int 10h
    inc cx
    cmp cx, 320
    jb draw_horizontal_line


	mov cx, 0
	mov dx, 133
draw_horizontal_line2:
    mov ah, 0Ch
    int 10h
    inc cx
    cmp cx, 320
    jb draw_horizontal_line2
	
	popa
	ret
endp draw_map

proc get_rectangle

	; function returns the square that the user pressed on
	
	mov ax, 01h
	int 33h

; main loop that checks if user pressed left button
mloop:
    mov ax, 03h
    int 33h

    cmp bx, 1
    jne mloop 

    ; searching in which square user pressed the button
    mov ax, cx
	shr ax, 1
    cmp ax, 106
    jb column_0
    cmp ax, 213
    jb column_1
    jmp column_2

column_0:
    jmp check_row

column_1:
    mov [square], 1 
    jmp check_row

column_2:
    mov [square], 2 

check_row:
    mov bx, dx
    cmp bx, 66
    jb row_0
    cmp bx, 133
    jb row_1
    jmp row_2

row_0:
    jmp end_check

row_1:
    add [square], 3
    jmp end_check

row_2:
    add [square], 6
	
end_check:
	; waiting when the user will release the button
	mov ax, 03h
	int 33h
	cmp bx, 1
	je end_check
	
	; turning off the mouse to draw shape
	mov ax, 0002h
	int 33h
	ret
endp get_rectangle

proc replay

	; function sets 1 in restarting, if user pressed "play again"
	
	mov ax, 01h
	int 33h

; main loop that checks if user pressed left button
wloop:

    mov ax, 03h
    int 33h

    cmp bx, 1
    jne wloop 

    ;checking that was pressed the lower part of the screen
    mov bx, dx
    cmp bx, 133
    ja restart
	jmp fin

restart:
	mov [restarting], 1
fin:
	; waiting when the user will release the button
	mov ax, 03h
	int 33h
	cmp bx, 1
	je fin
	ret
endp replay

proc change_shape
	
	; function changes value of "shape" from 1 to 2 or vice versa
	
	pusha
	xor cx, cx
	mov cl, [shape]
    cmp cl, 1
    je  change_to_2 

    jmp change_to_1  

change_to_2:
    mov [shape], 2
    jmp end_change

change_to_1:
    mov [shape], 1

end_change:
	popa
	ret
endp change_shape

start :
	mov ax, @data
	mov ds, ax
	
	; setting graphic mode
	
	mov ax, 13h
	int 10h
	
	call draw_map
	
turn:
	; every time reset value of "square"
	mov [square], 0
	call get_rectangle
	
	mov ax, [square]
	
	; putting the shape in the right place of the right varible (row1/row2/row3)
	cmp ax, 2
	ja second_row
	mov bx, offset row1
	mov di, ax
	cmp [byte ptr bx + di], 0
	jne turn
	call change_shape
	mov cl, [shape]
	mov [bx + di], cl
	jmp draw
	
second_row:
	cmp ax, 5
	ja third_row
	mov bx, offset row2
	sub ax, 3
	mov di, ax
	cmp [byte ptr bx + di], 0
	jne turn
	call change_shape
	mov cl, [shape]
	mov [bx + di], cl
	add ax, 3
	jmp draw
	
third_row:
	mov bx, offset row3
	sub ax, 6
	mov di, ax
	cmp [byte ptr bx + di], 0
	jne turn
	call change_shape
	mov cl, [shape]
	mov [bx + di], cl
	add ax, 6
	jmp draw

help_jump:
	; finish the program if all the squares are filled
	cmp [number_of_turn], 9
	je finish
	inc [number_of_turn]

	jmp turn

draw:
	; checking what shape user need to draw and drawing
	cmp [shape], 2
	je draw_zero
	jmp draw_cross

start_jump2:
	jmp start
	
draw_cross:
	call get_square_coords
	push ax
	push cx
	push 106
	push 66
	push offset cross
	
	call draw_sign
	jmp check
	
draw_zero:
	call get_square_coords
	push ax
	push cx
	push 106
	push 66
	push offset zero
	
	call draw_sign
	
check:

	; checking if there is winner
	
	call check_winner
	cmp [winner], 0
	je help_jump
	jmp finish

start_jump1:
	; help jump that also refreshes all start varibles
	call start_varibles
	jmp start_jump2

	
finish:
	
	; drawing
	
	push 0
	push 134
	push 106
	push 66
	push offset play_again1
	
	call draw_sign
	
	push 107
	push 134
	push 106
	push 66
	push offset play_again2
	
	call draw_sign
	
	push 214
	push 134
	push 106
	push 66
	push offset play_again3
	
	call draw_sign
	
	cmp [winner], 1
	je crs_won
	cmp [winner], 2
	je zero_won
	jmp check_restart
	
	
crs_won:
	push 107
	push 67
	push 106
	push 66
	push offset cross_win
	
	call draw_sign
	
	jmp check_restart
	
zero_won:
	push 107
	push 67
	push 106
	push 66
	push offset zero_win
	
	call draw_sign
	
	jmp check_restart

check_restart:
	; checking what the user pressed - if not play again, closes window of the game
	call replay
	cmp [restarting], 1
	je start_jump1


exit:
	mov ax, 03h
	int 010h
	mov ax, 4c00h
	int 21h
	
proc start_varibles

	; function refreshes all start varibles
	
	mov [restarting], 0
	mov [winner], 0
	mov [number_of_turn], 1
	mov [shape], 2
	mov cl, 0
	
	mov bx, offset row1
	mov [bx], cl
	mov [bx + 1], cl
	mov [bx + 2], cl
	
	mov bx, offset row2
	mov [bx], cl
	mov [bx + 1], cl
	mov [bx + 2], cl
	
	mov bx, offset row3
	mov [bx], cl
	mov [bx + 1], cl
	mov [bx + 2], cl
endp start_varibles
	
proc get_square_coords

	; function sets coordinates of the square (ax - x; cx - y)
	
    cmp ax, 0
    je set_case_0
    cmp ax, 1
    je set_case_1
    cmp ax, 2
    je set_case_2
    cmp ax, 3
    je set_case_3
    cmp ax, 4
    je set_case_4
    cmp ax, 5
    je set_case_5
    cmp ax, 6
    je set_case_6
    cmp ax, 7
    je set_case_7
    cmp ax, 8
    je set_case_8
    jmp end_function

set_case_0:
    xor ax, ax 
    xor cx, cx
    jmp end_function

set_case_1:
    mov ax, 107
    xor cx, cx
    jmp end_function

set_case_2:
    mov ax, 214
    xor cx, cx
    jmp end_function

set_case_3:
    xor ax, ax
    mov cx, 67
    jmp end_function

set_case_4:
    mov ax, 107
    mov cx, 67
    jmp end_function

set_case_5:
    mov ax, 214
    mov cx, 67
    jmp end_function

set_case_6:
    xor ax, ax
    mov cx, 134
    jmp end_function

set_case_7:
    mov ax, 107
    mov cx, 134
    jmp end_function

set_case_8:
    mov ax, 214
    mov cx, 134
    jmp end_function

end_function:
    ret
endp get_square_coords


proc check_winner
	
	pusha

    lea si, [row1]    ; load the address of row1 into SI
    mov al, [si]
    cmp al, 0
    je check_row2     ; skip if the first element is 0
    mov bl, [si + 1]
    cmp al, bl
    jne check_row2    ; skip if the elements are not equal
    mov bl, [si + 2]
    cmp al, bl
    jne check_row2
    mov [winner], al  ; set the winner
    jmp done

check_row2:
    ; check the second row
    lea si, [row2]
    mov al, [si]
    cmp al, 0
    je check_row3
    mov bl, [si + 1]
    cmp al, bl
    jne check_row3
    mov bl, [si + 2]
    cmp al, bl
    jne check_row3
    mov [winner], al
    jmp done

check_row3:
    ; check the third row
    lea si, [row3]
    mov al, [si]
    cmp al, 0
    je check_columns
    mov bl, [si + 1]
    cmp al, bl
    jne check_columns
    mov bl, [si + 2]
    cmp al, bl
    jne check_columns
    mov [winner], al
    jmp done

check_columns:
    ; check the first column
    mov al, [row1]
    cmp al, 0
    je check_column2
    mov bl, [row2]
    cmp al, bl
    jne check_column2
    mov bl, [row3]
    cmp al, bl
    jne check_column2
    mov [winner], al
    jmp done

check_column2:
    ; check the second column
    mov al, [row1 + 1]
    cmp al, 0
    je check_column3
    mov bl, [row2 + 1]
    cmp al, bl
    jne check_column3
    mov bl, [row3 + 1]
    cmp al, bl
    jne check_column3
    mov [winner], al
    jmp done

check_column3:
    ; check the third column
    mov al, [row1 + 2]
    cmp al, 0
    je check_diagonals
    mov bl, [row2 + 2]
    cmp al, bl
    jne check_diagonals
    mov bl, [row3 + 2]
    cmp al, bl
    jne check_diagonals
    mov [winner], al
    jmp done

check_diagonals:
    ; check the first diagonal
    mov al, [row1]
    cmp al, 0
    je check_diagonal2
    mov bl, [row2 + 1]
    cmp al, bl
    jne check_diagonal2
    mov bl, [row3 + 2]
    cmp al, bl
    jne check_diagonal2
    mov [winner], al
    jmp done

check_diagonal2:
    ; check the second diagonal
    mov al, [row1 + 2]
    cmp al, 0
    je no_winner
    mov bl, [row2 + 1]
    cmp al, bl
    jne no_winner
    mov bl, [row3]
    cmp al, bl
    jne no_winner
    mov [winner], al
    jmp done

no_winner:
    ; if there is no winner
    mov [winner], 0

done:
	popa
	ret
endp check_winner
   
   
proc draw_sign

    ;----------------------------------------------
	;print an image
	;input:
	;   x_printImage - the x value of top left corner
	;   y_printImage - the y value of top left corner
	;	width_printImage - the width if the image
	;	height_printImage - the length of the image
	;	image_printImage the image
	;----------------------------------------------
	push bp
	mov bp, sp
	pusha
	mov bx, image_printImage
	xor si, si
	xor dx, dx
	mov cx, height_printImage
printcols:
	push cx
	push x_printImage
	mov cx, width_printImage
printRows:
	mov dl, [byte ptr bx + si]
	push x_printImage
	push y_printImage
	push dx
	call one_dot
	inc x_printImage
	inc si
	loop printRows
	inc y_printImage
	pop x_printImage
	pop cx
	loop printcols
	popa
	pop bp
	ret 10
endp draw_sign

proc one_dot
	;----------------------------------------------
	;print a single dot
	;input:
	;	x_one_dot - the x coordiate of the dot
	;	y_one_dot - the y coordiate of the dot
	;	color_one_dot - the color of the dot	
	;----------------------------------------------
    push bp
	mov bp, sp
	pusha
	;mov bh,0h
	mov cx, x_one_dot
	mov dx, y_one_dot
	mov ax, color_one_dot
	mov ah, 0ch
	int 10h
	popa
	pop bp
	ret 6
endp one_dot


END start
      
